// returns NULL if there is no fixed CFF for the given t and d
cff_t* get_fixed_cff(int d, int t)
{
    switch (d)
    {
    case 2:
        switch (t)
        {
        case 12:
            return cff_2_12_20();
            break;
        case 13:
            return cff_2_13_26();
            break;
        case 14:
            return cff_2_14_28();
            break;
        case 15:
            return cff_2_15_42();
            break;
        case 16:
            return cff_2_16_48();
            break;
        case 17:
            return cff_2_17_68();
            break;
        case 18:
            return cff_2_18_69();
            break;
        case 19:
            return cff_2_19_76();
            break;
        case 20:
            return cff_2_20_90();
            break;
        case 21:
            return cff_2_21_120();
            break;
        case 22:
            return cff_2_22_176();
            break;
        case 23:
            return cff_2_23_253();
            break;
        default:
            return NULL;
            break;
        }
        break;
    default:
        return NULL;
        break;
    }
}

